import React, { useState, useEffect } from 'react';

function PlayerInfo() {
  const [data, setData] = useState([]);

useEffect(() => {
  fetch("http://localhost:3001/Players")
  .then((result)=> result.json())
  .then((players)=> setData(players))
}) 

}
PlayerInfo()

export default PlayerInfo;
